import { Component, ViewChild, Inject } from '@angular/core';
import { StageComponent } from './stage.component';
import { MatTableDataSource, MatPaginator, MatSort, MatDialog, MAT_DIALOG_DATA } from '@angular/material';
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
	title = 'Born To Help';
	displayedColumns = ['route_no','service_type', 'origin', 'destination', 'journy_time'];
	dataSource = new MatTableDataSource<Element>(ELEMENT_DATA);

	applyFilter(filterValue: string) {
		filterValue = filterValue.trim(); // Remove whitespace
		filterValue = filterValue.toLowerCase(); // MatTableDataSource defaults to lowercase matches
		this.dataSource.filter = filterValue;
	}
	@ViewChild(MatPaginator) paginator: MatPaginator;
	@ViewChild(MatSort) sort: MatSort;
	ngAfterViewInit() {
		this.dataSource.paginator = this.paginator;
		this.dataSource.sort = this.sort;
	}

	constructor(public dialog: MatDialog) {}
	openDialog(inp_route_no) {
		this.dialog.open(StageComponent, {
		data: {route_no: inp_route_no}
	});
	}
}

